Zeichnet man $\Spec A$, so zeichnet man jedes Primideal $\pfr$ als seinen topologischen Abschluss $\overline{\pfr}$, also dessen Verschwindungsmenge $V(\pfr)$:

\[\overline{\pfr} = 
	\underbrace{\text{kleinste}}_{\text{\normalsize gr\xc3\xb6\xc3\x9ftes $\qfr\in\Spec A$}} 
	\underbrace{\text{abgeschlossene Menge}}_{\text{\normalsize $V(\qfr)$}}
	\underbrace{\text{, die $\pfr$ enth\xc3\xa4lt}}_{\text{\normalsize mit $\qfr\subseteq\pfr$}}
	= V(\pfr)
\]

$\pfr$ nennt man dann \emph{generischen Punkt zu $\overline{\pfr}$}.

\begin{minipage}{.56\textwidth}
Zu $f \in A$, $\pfr \in \Spec A$ nennt man $[f] \in{} A/\pfr$ \emph{Wert von $f$}. Denn z.B. f\xc3\xbcr $\pfr = (X-a,Y-b)$ gilt:
\begin{align*}
A &\to A/\pfr \cong \IC \\
f &\mapsto [f] \mapsto f(a,b)
\end{align*}
Gilt $g \in \pfr$, so sagt man \emph{$g$ verschwindet an $\pfr$}, denn es ist:
\begin{align*}
A &\to A/\pfr \\
f &\mapsto [f] = [0]
\end{align*}
\end{minipage}
